export default  class Registration extends Component{
    constructor(props){
        super(props);
        
        this.state={
                name:'',
                phone:'',
                email:'',
                company:'',
                role:'',
                description:''
        }  
    }

    onChangeClientName(e){
        this.setState({
            name:e.target.value
        });
    }

    onChangeClientPhone(e){
        this.setState({
            phome:e.target.value
        });
    }

    onChangeClientEmail(e){
        this.setState({
            email:e.target.value
        });
    }

    onChangeClientCompany(e){
        this.setState({
            company:e.target.value
        });
    }

    onChangeClientRole(e){
        this.setState({
            role:e.target.value
        });
    }

    onChangeClientDescription(e){
        this.setState({
            description:e.target.value
        });
    }

    render(){
        return(
            <form>
                Registration
                <label>Name</label>
            </form>
        )
    }
}
